(33, 'page_privacy', '<p>Your Cab attaches great importance to the protection of their users&rsquo; personal data. All users personal information (title, name, address, e-mail address, telephone number, and locations) submitted is collected, stored, and processed exclusively in accordance with the country-specific legal provisions concerning data protection.<br />\r\n<br />\r\nYour Cab does not require users to submit credit card details and therefore does not store credit card details, however, the app will require your permission to use your location.</p>\r\n'),
(34, 'terms', '<p>According with the definitions listed below, these terms and conditions fully regulate the commercial relationship between YOUR CAB and the Users of the Platform.</p>\r\n\r\n<ol>\r\n	<li>DEFINITIONS</li>\r\n</ol>\r\n\r\n<ul>\r\n	<li>&quot;YOUR CAB&quot;: is YOUR CAB &nbsp;with address at &nbsp;Portlaoise, Ireland, with contact telephone number 0873808053 and email <a href=\"mailto:info@yourcab.ie\">info@yourcab.ie</a></li>\r\n	<li>&nbsp;&quot;Platform&quot;: integrate the website www.yourcab.ie and the application for Smartphone devices (APP) YOURCAB.</li>\r\n	<li>&nbsp;&ldquo;Small Public Service Vehicle&rdquo; (SPSV)&quot;: The public service as vehicles capable of carrying for hire passengers in taxi vehicles, according with The Taxi Regulation Act 2013 as well as any other regulations that develop, modify or replace it.</li>\r\n	<li>&quot;Taxi Driver (s)&quot;: Is the driver registered in the Platform and authorized to operate the vehicle intended for the provision of the Small Public Service Vehicle.</li>\r\n	<li>&quot;Passenger (s)&quot;: the natural person, who moves under a contract with a transport service provider, when a request for service has been made through the Platform.</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>SERVICES OFFERED BY YOUR CAB.</li>\r\n</ol>\r\n\r\n<p>YOUR CAB is a provider of technological solutions that allow the efficient provision of transport services to third parties authorized by the Law to provide those services; (registered taxi drivers)</p>\r\n\r\n<p>YOUR CAB is not a transport company, nor acts as a representative, commercial agent or commission agent of a transport company.</p>\r\n\r\n<p>YOUR CAB manages a Platform that serves as a contact portal between Passengers and Taxi Drivers for the conclusion of contracts for Individual Transportation Services.</p>\r\n\r\n<p>The Basic Service offered by YOUR CAB allows Passengers who are registered in the Platform to request Small Public Services Vehicle.</p>\r\n\r\n<p>Once the request is made, the Platform communicates it to the nearest taxi driver from the Passenger&#39;s location, within a specific radius. The taxi driver has a response time to accept or reject the Passenger&#39;s request, once the time indicated has elapsed, it will be understood that the taxi driver has rejected the request and the app will send the request to the next nearest driver and so on.</p>\r\n\r\n<p>The Platform uses an algorithm that evaluates which is the closest Taxi Driver and assigns the fare to the Taxi Driver. If in the specified time and radius there is no Taxi Driver available or none of the nearby taxi drivers accepts the fare.&nbsp;</p>\r\n\r\n<p>If after that nobody has accepted the fare, the Platform will inform the Passenger that there are no available taxis in the requested area.</p>\r\n\r\n<ol>\r\n	<li>DOWNLOAD, INSTALLATION AND UPDATING OF THE APP</li>\r\n</ol>\r\n\r\n<p>Downloading, installing and updating the YOUR CAB APP can be done from the main mobile application stores (App Store, Google Play); the use of outdated versions of the application could affect its correct operation, in case you require technical support related to the application you can write us to the email info@yourcab.ie</p>\r\n\r\n<p>The User must verify, before making any download or installation, that the YOURCAB APP is compatible with their devices. In any case, the User is solely responsible for any damage caused to their devices by the installation or use of non-compatible versions of the YOUR CAB APP, for example, installation from unofficial websites or stores.</p>\r\n\r\n<p>The Platform only can determine the Taxi drivers available by using the location service of the device where the App is been installed. For the only purposes of the service the User must allow the access to the location services and must have internet services.</p>\r\n\r\n<p>4. REGISTRATION OF USERS</p>\r\n\r\n<p>In order to access any of the services offered by YOUR CAB, the User must register on the Platform and accept these terms and conditions.</p>\r\n\r\n<p>The registration requires the full name, user name, email address and telephone number. &nbsp;By registering on the Platform, the User declares and guarantees that the information and data entered into the Platform are true and up-to-date and that it is older and has full capacity to grant authorization to process your personal data and to contract the obligations set in these terms and conditions.</p>\r\n\r\n<p>The rights acquired with the registry are personal and non-transferable. The password of entry registered by the User must not be informed to third parties and must be used with the utmost prudence and diligence, any damage or injury that is caused by the theft or misuse of it will be the sole responsibility of the User.<br />\r\nIn any case, YOURCAB reserves the right to verify by any lawful means the veracity of the information registered by the Users and to accept or deny the registration</p>\r\n\r\n<p>SPECIAL CONDITIONS OF REGISTRATION FOR TAXI DRIVERS</p>\r\n\r\n<p>The Drivers Registry requires a prior evaluation of requirements and certain additional information, such as driver&#39;s license number, vehicle licence number and vehicle registration number. Only registered vehicles with the appropriate licence for The National Transport Authority to operate the vehicle will be authorised to use the Platform.</p>\r\n\r\n<p>5. LICENSE OF USE OF SOFTWARE</p>\r\n\r\n<p>YOUR CAB grants each Registered User a non-exclusive, limited, temporary and non-transferable license that authorizes to access and use the Platform, in accordance with the conditions of this license agreement.</p>\r\n\r\n<p>YOUR CAB is free for the Drivers for the first three months with a price of five Euros plus VAT (&euro; 6.15) per week after that period.</p>\r\n\r\n<p>The User may not use or publish content of the Platform in any Web page, or any other public access support; neither may decompose, decompile or reverse engineer the Platform. In any case, any use that YOURCAB has not expressly authorized and in writing to the User is deemed prohibited</p>\r\n\r\n<p>YOUR CAB and its suppliers, distributors, representatives and employees, deny and reject any responsibility for losses, costs and expenses of any kind, arising or related to this software license.</p>\r\n\r\n<p>YOUR CAB is and will at all times be the sole owner of all intellectual property rights and other rights related to the Platform. The trademarks and logos that appear on the Platform are trademarks or registered trademarks of YOURCAB. Trademarks and trade names, images, names of products and logos of third parties included are trademarks or registered trademarks of their respective owners.</p>\r\n\r\n<p>YOUR CAB will make its best efforts so that the Platform operates correctly 24 hours a day; however, it is not guaranteed that the Platform is available at all times or that it is free of errors.</p>\r\n\r\n<p>YOUR CAB may revoke this license agreement at any time if the User breaches any of the conditions of the same, in which case the User may not use the Platform.</p>\r\n\r\n<p>SPECIAL CONDITIONS OF THE PASSENGER USE LICENSE</p>\r\n\r\n<p>The license for the use of software granted to the Passenger is free of charge; however, the Passenger may only make personal use of the Platform. Any type of economic or commercial utilization, either directly or through third parties, is expressly prohibited.</p>\r\n\r\n<p>TERM AND TERMINATION</p>\r\n\r\n<p>The Terms and conditions will begin on the date of the complete registration with the Platform and any of the parties have the right to terminate them at any time.</p>\r\n'),
